export class Block {
  total_block_produced_within_time: number;
  total_missed_blocks: number;
  duration_in_hrs: number;
  number_of_validators: number;

  constructor() {
    this.total_block_produced_within_time = 1;
    this.total_missed_blocks = 1;
    this.duration_in_hrs = 1;
    this.number_of_validators = 1;
  }
}
